import {BrowserRouter,Routes,Route} from 'react-router-dom'
import Home from './components/Home';
import Apartament from './components/Apartament';
import Contact from './components/Contact';
import Rio from './components/Rio'
import Book from './components/Book'
import RoomDescription from './RoomDescription';
import { useState } from 'react';


function App() {
  const[state,setState]=useState([
    {
      description:'junior',
      id:0,
    },
    {
      description:'standart',
      id:1
    },
    {
      description:'superior',
      id:2
    },
    {
      description:'standart',
      id:4
    }
  ])

  return (
    <div className="App">
      <BrowserRouter>
         <Routes>
           <Route path='/' element={<Home/>}/>
           <Route path='/Our Apartament' element={<Apartament/>}/>
           <Route path='/Rio' element={<Rio/>}/>
           <Route path='/Contact'element={<Contact/>}/>
           <Route path='/Book' element={<Book/>}/>
           {/* <Route path='/roomdescription/:name' element={<RoomDescription description='junior'/>}/> */}
           {/* <Route path='/roomdescription/:name' element={<RoomDescription description='standart'/>}/> */}
           {/* <Route path='/roomdescription/:name' element={<RoomDescription description='superior'/>}/> */}
           {/* <Route path='/roomdescription/:name' element={<RoomDescription description='standart'/>}/> */}
         </Routes>
      </BrowserRouter>
      {state.map((item,i)=>{
        return(
          <>
          <BrowserRouter>
          <Routes>
          <Route key={i} path='/roomdescription/:name' element={<RoomDescription description={item.id===1&&item.description}/>}/>
          </Routes>
          </BrowserRouter>
          </>
        )

      })}
    </div>
  );
}

export default App;
